webMI.data.subscribe("Server1/Q_SYS/.DieselConfig[1].Nominal_kVA", function(e) {
var id = "id_0";
var value = e.value;
if (value == 1)
	webMI.gfx.setVisible(id, true);
if (value == 0)
	webMI.gfx.setVisible(id, false);

});

